import React from 'react';
import { useRouter } from "next/router";
import { Pagination } from 'semantic-ui-react';

function PicturesPagination({ page, totalPages }) {
  const router = useRouter();

  return (
    <Pagination
      boundaryRange={0}
      defaultActivePage={page}
      ellipsisItem={null}
      firstItem={null}
      lastItem={null}
      siblingRange={1}
      totalPages={10}
      onPageChange={(event, data) => {
        data.activePage === 1
          ? router.push("/")
          : router.push(`/?page=${data.activePage}`)
      }}
    />
  );
}


export default PicturesPagination;
